import React from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import AgregarViaje from './AgregarViaje';
import ConsultarViajes from './ConsultarViajes';

function App() {
  return (
    <Router>
      <div>
        <nav>
          <Link to="/">Inicio</Link>
          <Link to="/agregar-viaje">Agregar Viaje</Link>
          <Link to="/consultar-viajes">Consultar Viajes</Link>
        </nav>
        <Routes>
          <Route path="/" element={<h1>Bienvenido a la gesti√≥n de viajes</h1>} />
          <Route path="/agregar-viaje" element={<AgregarViaje />} />
          <Route path="/consultar-viajes" element={<ConsultarViajes />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
